<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>LeetCode solutions with Python</title>
  <meta name="keywords" content="leetcode, solutions, python">
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
  <meta name="description" content="leetcode solutions">
  <meta name="viewport" content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
  <link rel="stylesheet" href="//unpkg.com/docsify/lib/themes/vue.css">
</head>
<body>
  <div id="app"></div>
  <script>
    window.$docsify = {
      loadSidebar: true,
      loadNavbar: true,
      auto2top: true,
      maxLevel: 4,
      subMaxLevel: 3,
      themeColor: '#60b0f4',
      repo: 'https://github.com/ipudu/leetcode',
      homepage: 'https://raw.githubusercontent.com/ipudu/leetcode-solutions/master/README.md',
      disqus: 'leetcode-solutions-with-python',
      ga: 'UA-68610248-5',
      search: {
        paths: 'auto',
        placeholder: {
        '/zh-cn/': '搜索',
        '/': 'Search'
        },
      noData: {
        '/zh-cn/': '找不到结果',
        '/': 'No Results'
        }
      }
    }

  </script>
  <script src="//unpkg.com/docsify/lib/docsify.min.js"></script>
  <script src="//unpkg.com/docsify/lib/plugins/search.min.js"></script>
  <script src="//unpkg.com/docsify/lib/plugins/emoji.min.js"></script>
  <script src="//unpkg.com/docsify/lib/plugins/ga.min.js"></script>
  <script src="//unpkg.com/docsify-copy-code"></script>
  <script src="//unpkg.com/prismjs/components/prism-python.min.js"></script>
  <script src="//unpkg.com/docsify/lib/plugins/disqus.min.js"></script>
</body>
</html>
